var $bm_rt;
var src = thisLayer.parent;
var rect = src.sourceRectAtTime(time, true);
var padSlider = $bm_div(src.effect('Padding')('Slider'), 100);
var extra = $bm_mul(rect.width, padSlider);
var left = $bm_sub(rect.left, $bm_div(extra, 2));
var width = $bm_sum(rect.width, extra);
var height = rect.height;
var numLines = src.text.sourceText.value.split('\r').length;
var lineIndex = 0;
var lineHeight = $bm_div(height, numLines);
var y = $bm_sum(rect.top, $bm_mul(lineHeight, $bm_sum(lineIndex, 0.5)));
y = $bm_sum(y, [0]);
$bm_rt = createPath([
    [
        left,
        y
    ],
    [
        $bm_sum(left, width),
        y
    ]
], [], [], false);
